import { EnthusiasmAction } from './actions';
import { INCREMENT_ENTHUSIASM,INCREMENT_ENTHUSIASM_FINISH } from './actionTypes';

function reducer(state: object[] = [], action:EnthusiasmAction) : object{
    console.log(112,action)
    switch (action.type){
        case INCREMENT_ENTHUSIASM:
            return state
        case INCREMENT_ENTHUSIASM_FINISH:
            return action.demoStore
        default:
            return state
    }
}

const AppReducer = {
    demoStore: reducer
}

export default AppReducer
